import React from 'react';
import PropTypes from 'prop-types';
import RepoItem from './RepoItem';

const Repos = props => {
  return props.repos.map(repo => <RepoItem repo={repo} key={repo.id} />);
};

Repos.proptypes = {
  repose: PropTypes.array.isRequired
};

export default Repos;
